
history_value_1:
  id: 1
  setting_id: 1
  value: '<p><a href="http://fab-manager.com" target="_blank">Fab-manager</a> est
    outil de gestion des atelier de fabrication numérique, permettant de réserver
    des machines de découpe, des imprimantes 3D, etc. tout en gérant simplement les
    aspect financier, comptable et statistiques de votre espace.</p><p><a href="http://fab-manager.com"
    target="_blank">Fab-manager</a> est un projet libre: ouvert à tous, il offre la
    possibilité de contribuer soi-même au code, de télécharger le logiciel, de l''étudier
    et de le redistribuer. Vous n''êtes pas technicien ? Vous pouvez quand même participer
    à <a href="https://translate.fab-manager.com/">traduire Fab-manager dans votre
    langue</a>.</p><p> Fab-manager favorise le partage de connaissances grâce au réseau
    OpenLab: les projets que vous documentez sont partagés avec l''ensemble du réseau
    des Fab-managers.</p>'
  created_at: '2018-12-17 11:23:01.224566'
  updated_at: '2021-05-31 15:00:35.658406'
  footprint: fcc5700c917a25e79d5bb04b90531be52473b48cbe1e00009d412db88c9fc278
  invoicing_profile_id: 1

